pragma solidity ^0.4.18;

 import 'zeppelin-solidity/contracts/math/SafeMath.sol';

import './InterfaceImplementationRegistry.sol';
import './EIP820.sol';

import './AssetRegistryStorage.sol';

import './IAssetRegistry.sol';

import './IAssetHolder.sol';

import './AxEuroToken.sol';

contract AxStandardAssetRegistry is AssetRegistryStorage, IAssetRegistry, EIP820 {
  using SafeMath for uint256;


  function AxStandardAssetRegistry() public 
  {
    _contractOwner = msg.sender;
  }

  //
  // Global Getters
  //

  function name() public view returns (string) {
    return _name;
  }

  function symbol() public view returns (string) {
    return _symbol;
  }

  function description() public view returns (string) {
    return _description;
  }

  function totalSupply() public view returns (uint256) {
    return _count;
  }

  //
  // Asset-centric getter functions
  //

  function exists(uint256 assetId) public view returns (bool) {
    return _holderOf[assetId] != 0;
  }

  function holderOf(uint256 assetId) public view returns (address) {
    return _holderOf[assetId];
  }

  function safeHolderOf(uint256 assetId) public view returns (address) {
    address holder = _holderOf[assetId];
    require(holder != 0);
    return holder;
  }

  function assetData(uint256 assetId) public view returns (string) {
    return _assetData[assetId];
  }

  function safeAssetData(uint256 assetId) public view returns (string) {
    require(_holderOf[assetId] != 0);
    return _assetData[assetId];
  }

  //
  // Holder-centric getter functions
  //

  function assetCount(address holder) public view returns (uint256) {
    return _assetsOf[holder].length;
  }

  function assetByIndex(address holder, uint256 index) public view returns (uint256) {
    require(index < _assetsOf[holder].length);
    require(index < (1<<127));
    return _assetsOf[holder][index];
  }

  function assetsOf(address holder) external view returns (uint256[]) {
    return _assetsOf[holder];
  }

  //
  // Authorization getters
  //

  function isOperatorAuthorizedFor(address operator, address assetHolder)
    public view returns (bool)
  {
    return _operators[assetHolder][operator];
  }

  function authorizeOperator(address operator, bool authorized) public {
    if (authorized) {
      require(!isOperatorAuthorizedFor(operator, msg.sender));
      _addAuthorization(operator, msg.sender);
    } else {
      require(isOperatorAuthorizedFor(operator, msg.sender));
      _clearAuthorization(operator, msg.sender);
    }
    AuthorizeOperator(operator, msg.sender, authorized);
  }

  function _addAuthorization(address operator, address holder) private {
    _operators[holder][operator] = true;
  }

  function _clearAuthorization(address operator, address holder) private {
    _operators[holder][operator] = false;
  }

  //
  // Internal Operations
  //

  function _addAssetTo(address to, uint256 assetId) internal {
    _holderOf[assetId] = to;

    uint256 length = assetCount(to);

    _assetsOf[to].push(assetId);

    _indexOfAsset[assetId] = length;

    _count = _count.add(1);
  }

  function _addAssetTo(address to, uint256 assetId, string data) internal {
    _addAssetTo(to, assetId);

    _assetData[assetId] = data;
  }

  function _removeAssetFrom(address from, uint256 assetId) internal {
    uint256 assetIndex = _indexOfAsset[assetId];
    uint256 lastAssetIndex = assetCount(from).sub(1);
    uint256 lastAssetId = _assetsOf[from][lastAssetIndex];

    _holderOf[assetId] = 0;

    // Insert the last asset into the position previously occupied by the asset to be removed
    _assetsOf[from][assetIndex] = lastAssetId;

    // Resize the array
    _assetsOf[from][lastAssetIndex] = 0;
    _assetsOf[from].length--;

    // Remove the array if no more assets are owned to prevent pollution
    if (_assetsOf[from].length == 0) {
      delete _assetsOf[from];
    }

    // Update the index of positions for the asset
    _indexOfAsset[assetId] = 0;
    _indexOfAsset[lastAssetId] = assetIndex;

    _count = _count.sub(1);
  }

  function _removeAssetData(uint256 assetId) internal {
    _assetData[assetId] = '';
  }

  //
  // Supply-altering functions
  //

  function _generate(uint256 assetId, address beneficiary, string data) internal {
    require(_holderOf[assetId] == 0);

    _addAssetTo(beneficiary, assetId, data);

    Transfer(0, beneficiary, assetId, msg.sender, bytes(data), '');
  }

  function _destroy(uint256 assetId) internal {
    address holder = _holderOf[assetId];
    require(holder != 0);

    _removeAssetFrom(holder, assetId);
    _removeAssetData(assetId);

    Transfer(holder, 0, assetId, msg.sender, '', '');
  }

  //
  // Transaction related operations
  //

  modifier onlyHolder(uint256 assetId) {
    require(_holderOf[assetId] == msg.sender);
    _;
  }

  modifier onlyOperatorOrHolder(uint256 assetId) {
    require(_holderOf[assetId] == msg.sender
         || isOperatorAuthorizedFor(msg.sender, _holderOf[assetId]));
    _;
  }

  modifier isDestinataryDefined(address destinatary) {
    require(destinatary != 0);
    _;
  }

  modifier destinataryIsNotHolder(uint256 assetId, address to) {
    require(_holderOf[assetId] != to);
    _;
  }


  function transfer(address to, uint256 assetId) public {
    return _doTransfer(to, assetId, '', 0, '');
  }

  function transfer(address to, uint256 assetId, bytes userData) public {
    return _doTransfer(to, assetId, userData, 0, '');
  }

  function transfer(address to, uint256 assetId, bytes userData, bytes operatorData) public {
    return _doTransfer(to, assetId, userData, msg.sender, operatorData);
  }

  function _doTransfer(
    address to, uint256 assetId, bytes userData, address operator, bytes operatorData
  )
    isDestinataryDefined(to)
    destinataryIsNotHolder(assetId, to)
    onlyOperatorOrHolder(assetId)
    internal
  {
    return _doSend(to, assetId, userData, operator, operatorData);
  }


  function _doSend(
    address to, uint256 assetId, bytes userData, address operator, bytes operatorData
  )
    internal
  {
    address holder = _holderOf[assetId];
    _removeAssetFrom(holder, assetId);
    _addAssetTo(to, assetId);

    if (_isContract(to)) {
      require(!_reentrancy);
      _reentrancy = true;

      address recipient = interfaceAddr(to, 'IAssetHolder');
      require(recipient != 0);

      IAssetHolder(recipient).onAssetReceived(assetId, holder, to, userData, operator, operatorData);

      _reentrancy = false;
    }

    Transfer(holder, to, assetId, operator, userData, operatorData);
  }

  //
  // Update related functions
  //

  function _update(uint256 assetId, string data) internal {
    require(exists(assetId));
    _assetData[assetId] = data;
    Update(assetId, _holderOf[assetId], msg.sender, data);
  }

  //
  // Utilities
  //

  function _isContract(address addr) internal view returns (bool) {
    uint size;
    assembly { size := extcodesize(addr) }
    return size > 0;
  }

//Axgro specific:
////////////////////////////////////////////////////////////////////////
// events:
event Aggregate(address newOwner, uint commodityIdx, uint amount, uint256 newAssetId);
event NewStoreContract( address newCustomer, uint commodityIdx, uint costPerDay);
event StoreCommodity(address owner, uint commodityIdx, uint store_amount, uint store_date, uint256 assetId);
event SetShrinkage(uint commodityIdx, uint shrinkagePercent);
////////////////////////////////////////////////////////////////////////
// modifier
modifier isOwner() {
        require(msg.sender == _contractOwner);
        _;
    }

////////////////////////////////////////////////////////////////////////
// functions:

//4u added:
  function generate(uint256 assetId, address beneficiary, string data) public {
	_generate(assetId, beneficiary, data);
  }
  
  

  function offer(uint256 assetId) onlyHolder(assetId) public { 
	//TODO: add amount add time limit
  if(!_isOffered[assetId])
		_isOffered[assetId] = true;
	//TODO: generate event
  }
  
  function buy(address buyer, uint256 assetId, uint256 amount) public {
	// TODO: add reentrancy lock...
  
	if(_isOffered[assetId]) {
		_isOffered[assetId] = false;
		// get axtoken instance
		address axeuroaddr = 0xbFEa297CAD970b59364b5A0f9d78bfA42D705756;
		AxEuroToken axeuro = AxEuroToken(axeuroaddr);
		//axeuro.provide(_holderOf[assetId], amount);
		if(axeuro.transferFrom(buyer, _holderOf[assetId], amount)) {
				// change asset
				_doSend(buyer, assetId, '', 0, '');
		}
		else {
			_isOffered[assetId] = true;
        }
	}
  
  }
  

function setShrinkage(uint commodityIdx, uint shrinkagePercent) public isOwner()
{
  _shrinkage[commodityIdx] = shrinkagePercent;
  SetShrinkage(commodityIdx, shrinkagePercent);
}

function newStoreContract( address newCustomer, uint commodityIdx, uint costPerDay) public isOwner()  returns(uint) 
{

    uint costs = _storageCostsPerDay[commodityIdx][newCustomer];
    if(costs != 0) {
      // TODO: later compute commodity of this user until now & change _storageCostsPerDay to new costPerDay
      return costs;
    }
    else {
      _storageCostsPerDay[commodityIdx][newCustomer] = costPerDay;
      NewStoreContract(newCustomer, commodityIdx, costPerDay);
      return costPerDay;
    }
}

function safeNewStoreContract( address newCustomer, uint commodityIdx, uint costPerDay) public returns(uint)
{
  uint c = newStoreContract(newCustomer, commodityIdx, costPerDay);
  if(c != costPerDay) {
    revert();
  }
  return c;
}

function storeCommodity(address owner, uint commodityIdx, uint store_amount, uint store_date) public isOwner() returns(uint256)
{
    uint256 assetId;
    uint shrinkage = _shrinkage[commodityIdx];
    uint shrink = 0;
    if(shrinkage >= 0) {
      shrink = (store_amount * shrinkage) / 100; 
      store_amount -= shrink;
      _aggregate(_contractOwner, commodityIdx, shrink, store_date);
    }
    assetId = _aggregate(owner, commodityIdx, store_amount, store_date);
    
    StoreCommodity(owner, commodityIdx, store_amount, store_date, assetId);
    return assetId;
}

 function getCommodityAmount(uint commodityIdx) public returns(uint amount, uint256 assetId)
{
   (amount, assetId) = _getCommodityAmount(msg.sender, commodityIdx);
}

 function _getCommodityAmount(address owner, uint commodityIdx) internal returns(uint amount, uint256 assetId)
 {
    amount = 0;
    assetId = 0;
    uint cId = 0;   
    uint256 aId = _findCommodity(owner, commodityIdx);
    if(aId != 0) {
      (cId, amount) = _getFromAssetId(aId);
      if(cId != commodityIdx) {
        revert(); // error wrong commodity found
      }
      assetId = aId;
    }
 }

 function _aggregate( address newOwner, uint commodityIdx, uint buy_amount, uint buyDate ) internal returns (uint ) {

	uint amount = buy_amount;
	uint sc = 0;
	buyDate = (buyDate < now) ? now : buyDate;
    uint256 oldAssetId = _findCommodity(newOwner, commodityIdx);
	if (oldAssetId != 0) {
		(amount, sc) = _getActualCost(newOwner, buyDate, oldAssetId, buy_amount, commodityIdx) ;
	}
	bytes32 rd = keccak256(block.timestamp, msg.sender);
  uint256 newAssetId = _buildAssetId(commodityIdx, amount, rd);
	// addAsset
    _addAssetTo(newOwner, newAssetId);
    _storageCostsSoFar[newAssetId] = sc;
	_last_modify[newAssetId] = buyDate;

	if (oldAssetId != 0) {
		delete _storageCostsSoFar[oldAssetId];
		delete _last_modify[oldAssetId];
		_destroy(oldAssetId);

	}
  Aggregate(newOwner, commodityIdx, amount, newAssetId);
	return newAssetId;
}

function _getActualCost( address newOwner, uint buyDate, uint256 oldAssetId, uint newAmount, uint256 commodityIdx) internal returns(uint amount, uint sc) { 
	/*
  uint storageCosts;
    // new data to be used:
	uint date;
	storageCosts = _storageCostsSoFar[oldAssetId];
	date = _last_modify[oldAssetId];
	uint cpd = _storageCostsPerDay[commodityIdx][newOwner];
	uint datediff = (buyDate - date) / DAYSEC; 
	sc = storageCosts + (cpd * datediff);
  */
  sc = _updStorageCost(newOwner, oldAssetId, commodityIdx, buyDate);
  uint256 oldAmount;
	uint256 testIdx;
	(testIdx, oldAmount) = _getFromAssetId(oldAssetId);
	assert(testIdx == commodityIdx);
	amount = newAmount + oldAmount;
}

function _updStorageCost(address owner, uint256 assetId, uint256 commodityIdx, uint changeDate) internal returns(uint sc) {
  uint storageCosts;
	uint date;
	storageCosts = _storageCostsSoFar[assetId];
	date = _last_modify[assetId];
	uint cpd = _storageCostsPerDay[commodityIdx][owner];
	uint datediff = (changeDate - date) / DAYSEC; 
	sc = storageCosts + (cpd * datediff);
  _storageCostsSoFar[assetId] = sc;
  _last_modify[assetId] = changeDate;
  return sc;
}

function _splitAsset(uint256 commodityIdx, uint amount ) internal returns(uint256 splitAssetId)
{
  uint256 assetId = _findCommodity(msg.sender, commodityIdx);
  if(assetId != 0){
      uint256 cIdx;
      uint allAmount;
      (cIdx, allAmount) = _getFromAssetId(assetId);
      require(cIdx == commodityIdx);
      require(allAmount >= amount);
      _updStorageCost(msg.sender, assetId, commodityIdx, now);
      // split tokens
  }
}

function _isOffered_Till(uint256 assetId) internal returns(bool)
 {
   uint256 till = _isOfferedTill[assetId];
   if(till != 0) {
     if( till <= now) {  // no trade -> aggreagate again
        uint256 commodityIdx; 
        uint256 amount;
        delete (_isOfferedTill[assetId]);
        address owner = holderOf(assetId);
        (commodityIdx, amount) = _getFromAssetId(assetId);
         _aggregate(owner, commodityIdx, amount, now);
         till = 0;   
     }
   }
   return (till != 0); 
 }

  function _findCommodity(address owner, uint256 commodityIdx) internal returns( uint256 assetId) {
	  uint256 cIdx;
	  uint256 amount;
    if(assetCount(owner) == 0) {
      return 0;
    }
    uint256[] memory commAry = _assetsOf[owner];
	  for (uint i = 0; i < commAry.length; i++) {
		  (cIdx,amount) = _getFromAssetId(commAry[i]);
		  if(cIdx == commodityIdx) {
        if(!_isOffered_Till(commAry[i])) {
			      return commAry[i];
        }
		  }
	  }	
	  return 0;	
  }




  function  _bytes32ToString (bytes32 data) internal pure returns (string) {
    bytes memory bytesString = new bytes(32);
    for (uint j=0; j<32; j++) {
        byte char = byte(bytes32(uint(data) * 2 ** (8 * j)));
        if (char != 0) {
            bytesString[j] = char;
        }
    }
    return string(bytesString);
}
 
 
  function _bytesToUint256 (bytes b32) internal pure returns (uint256)
	{
	   uint256 o_ret = 0;
		if(b32.length != 32)
			return uint256(0);
			
       assembly {
 			o_ret := mload(add(b32, 0x20))
        }
		return o_ret;
    }	

  function _uint256ToBytes (uint256 i) internal pure returns (bytes)
	{
	   bytes memory o_ret = new bytes(32); 
       assembly {
	        mstore(o_ret, 0x20)
			mstore(add(o_ret, 0x20), i)
        }
		return o_ret;
    }	
	
	function _bytes32ToBytes(bytes32 b32) internal pure returns (bytes)
	{
		uint256 ui = uint256(b32);
		return _uint256ToBytes(ui);
	}	
	
	
	function _buildAssetId(uint commodity, uint amount, bytes32 rd) internal pure returns (uint256)
	{
		
		bytes32 c = bytes32(commodity);
		bytes32 a = bytes32(amount);
		
		bytes memory rand = _bytes32ToBytes(rd);
		if(rand.length != 32){ 
			return 0;   // exit
		}
		//Assert.equal(c.length, 32);
		//Assert.equal(a.length, 32);

		rand[30] = c[30];
		rand[31] = c[31];
		for(uint i = 0; i < 8; i++) {
			rand[22 + i] = byte(a[24 + i]);
		}
		uint256 rc = _bytesToUint256(rand);
		return rc;
	}
	
	function _getFromAssetId(uint256 aId) internal pure returns (uint256 commodity, uint256 amount)
	{
		bytes memory o_c = new bytes(32);
		bytes memory o_a = new bytes(32);

		bytes memory asset = _uint256ToBytes(aId);
		o_c[30] = asset[30];
		o_c[31] = asset[31];
		
		for(uint i = 0; i < 8; i++) {
			o_a[24 + i] = asset[22 + i];
		}
		commodity = _bytesToUint256(o_c);
		amount = _bytesToUint256(o_a);
		
	}


}
